import React from "react";
import "./Works.css"; 

const FWork = () => {
    const images = [
        "1.jpg", 
        "2.jpg", 
        "3.webp", 
        "4.webp", 
        "5.webp", 
        "6.webp", 
        
      ];
      const interimages = [
        "1.jpg", 
        "2.webp", 
        "3.jpg", 
        "4.jpg", 
        "5.jpg", 
        "6.jpg", 
        "7.jpg", 
        "8.jpg", 
        
      ];
      const d3images = [
        "1.jpg", 
        "2.jpg", 
        "3.jpg", 
   
      ];
      const extimages = [
        "1.jpg", 
        "2.jpg", 
        "3.jpg", 
        "4.jpg", 
        "5.jpg", 
        "6.webp", 
        "7.jpg", 
        "8.jpg", 
        
      ];
    return (
  
        <section className="bg-white py-12 hero-section3 ">
        <div className="max-w-7xl  px-6">
          <h2 className="text-3xl font-bold  mb-12">Interior Design</h2>
  
          <div className="flex justify-center items-center ">
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4 w-[90%] ">
      {interimages.map((image) => (
        <div key={image} className="w-full h-52">
               <a
            href={`/inter/${image}`} 
            target="_blank" 
            rel="noopener noreferrer" 
          >
          <img
            src={`/inter/${image}`} 
            alt={`Work ${image}`}
            className="object-cover w-full h-full rounded-md shadow-md"
          /></a>
        </div>
      ))}
    </div></div>
  
          {/* Categories */}
          <div className="mt-12">
            <h3 className="text-3xl font-semibold mb-4">2D Design</h3><br></br>
            <div className="flex justify-center items-center ">
            <div className="grid grid-cols-2 md:grid-cols-2 gap-4 ">
      {images.map((image) => (
        <div key={image} className="w-full h-52">
               <a
            href={`/2d/${image}`} 
            target="_blank" 
            rel="noopener noreferrer" 
          >
          <img
            src={`/2d/${image}`} 
            alt={`Work ${image}`}
            className="object-cover w-full h-full rounded-md shadow-md"
          /></a>
        </div>
      ))}
    </div></div>
  
          </div>
  
          <div className="mt-12">
            <h3 className="text-3xl font-semibold mb-4">3D Design</h3><br></br>
            <div className="flex justify-center items-center ">
            <div className="grid grid-cols-2 md:grid-cols-1 gap-4 w-[90%]">
      {d3images.map((image) => (
        <div key={image} className="w-full h-52">
               <a
            href={`/3D/${image}`} 
            target="_blank" 
            rel="noopener noreferrer" 
          >
          <img
            src={`/3D/${image}`} 
            alt={`Work ${image}`}
            className="object-cover w-full h-full rounded-md shadow-md"
          /></a>
        </div>
      ))}
    </div></div>
          </div>
          <div className="mt-12">
            <h3 className="text-3xl  font-semibold mb-4">Exterior Design</h3><br></br>
            <div className="flex justify-center items-center ">
            <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
      {extimages.map((image) => (
        <div key={image} className="w-full h-52">
               <a
            href={`/ext/${image}`} 
            target="_blank" 
            rel="noopener noreferrer" 
          >
          <img
            src={`/ext/${image}`} 
            alt={`Work ${image}`}
            className="object-cover w-full h-full rounded-md shadow-md"
          /></a>
        </div>
      ))}
    </div></div>
          </div>
        </div>
      </section>
    );
  };
  
  export default FWork;
